-- Users Table
CREATE TABLE users (
    id NUMBER GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    username VARCHAR2(255) NOT NULL,
    created_at TIMESTAMP DEFAULT SYSDATE
);

-- Photos Table
CREATE TABLE photos (
    id NUMBER GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    image_url VARCHAR2(355) NOT NULL,
    user_id NUMBER NOT NULL,
    created_at TIMESTAMP DEFAULT SYSDATE,
    CONSTRAINT fk_photos_user FOREIGN KEY (user_id) REFERENCES users(id)
);

-- Comments Table
CREATE TABLE comments (
    id NUMBER GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    comment_text VARCHAR2(255) NOT NULL,
    user_id NUMBER NOT NULL,
    photo_id NUMBER NOT NULL,
    created_at TIMESTAMP DEFAULT SYSDATE,
    CONSTRAINT fk_comments_user FOREIGN KEY (user_id) REFERENCES users(id),
    CONSTRAINT fk_comments_photo FOREIGN KEY (photo_id) REFERENCES photos(id)
);
drop table comments;
-- Likes Table
CREATE TABLE likes (
    user_id NUMBER NOT NULL,
    photo_id NUMBER NOT NULL,
    created_at TIMESTAMP DEFAULT SYSDATE,
    CONSTRAINT pk_likes PRIMARY KEY (user_id, photo_id),
    CONSTRAINT fk_likes_user FOREIGN KEY (user_id) REFERENCES users(id),
    CONSTRAINT fk_likes_photo FOREIGN KEY (photo_id) REFERENCES photos(id)
);

-- Follows Table
CREATE TABLE follows (
    follower_id NUMBER NOT NULL,
    followee_id NUMBER NOT NULL,
    created_at TIMESTAMP DEFAULT SYSDATE,
    CONSTRAINT pk_follows PRIMARY KEY (follower_id, followee_id),
    CONSTRAINT fk_follows_follower FOREIGN KEY (follower_id) REFERENCES users(id),
    CONSTRAINT fk_follows_followee FOREIGN KEY (followee_id) REFERENCES users(id)
);

-- Tags Table
CREATE TABLE tags (
    id NUMBER GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    tag_name VARCHAR2(255) UNIQUE NOT NULL,
    created_at TIMESTAMP DEFAULT SYSDATE
);

-- Photo-Tags Junction Table
CREATE TABLE photo_tags (
    photo_id NUMBER NOT NULL,
    tag_id NUMBER NOT NULL,
    CONSTRAINT pk_photo_tags PRIMARY KEY (photo_id, tag_id),
    CONSTRAINT fk_photo_tags_photo FOREIGN KEY (photo_id) REFERENCES photos(id),
    CONSTRAINT fk_photo_tags_tag FOREIGN KEY (tag_id) REFERENCES tags(id)
);

